import React, { useEffect, useState } from "react";
import "../../App.scss";
import "./Search.scss";
import TopBar from "../../components/TopBar/TopBar";
import Footer from "../../components/Footer/Footer";
import { Link } from "react-router-dom";

const Search = () => {
  const [models, setModels] = useState([]);

  useEffect(() => {
    const fetchModels = async () => {
      try {
        const response = await fetch(
          "http://127.0.0.1:8000/models/main/?limit=6&offset=12"
        );
        if (!response.ok) throw new Error("Failed to fetch models");

        const data = await response.json();
        setModels(data.results);
      } catch (error) {
        console.error("Error fetching models:", error);
      }
    };

    fetchModels();
  }, []);

  return (
    <>
      <div className="man-page">
            <div className="top-bar">
              <div className="top-bar__navigation">
                <nav className="top-bar__nav">
                  <ul className="top-bar__list">
                    <li className="top-bar__item">
                      <Link to="/woman" className="top-bar__link">
                        Women
                      </Link>
                    </li>
        
                    <li className="top-bar__item">
                      <Link to="/man" className="top-bar__link">
                        Man
                      </Link>
                    </li>
                    <li className="top-bar__item">
                      <Link to="/newsletter" className="top-bar__link">
                        Newsletter
                      </Link>
                    </li>
                    <li className="top-bar__item top-bar__item-contact">
                      <Link to="/contact" className="top-bar__link">
                        Contact
                      </Link>
                    </li>
                  </ul>
                </nav>
              </div>
        
              <div className="top-bar__logo">
                <div className="top-bar__logo-main">Axiom</div>
                <div className="top-bar__logo-second">MODEL MANAGEMENTLLC</div>
              </div>
        
              <Link to="/search" className="top-bar__search">
                <div className="top-bar__search-container">
                  <div className="top-bar__search-elements">
                    <div className="top-bar__search-icon">
                      <img
                        src="/icons/header/search.svg"
                        alt="search"
                        className="top-bar__search-item"
                      />
                    </div>
                    <div className="top-bar__search-text">Search Model</div>
                  </div>
                </div>
              </Link>
        
              <button type="button" className="btn--mobile-nav">
                <a href="#menu">
                  <img src="/icons/header/burger-menu.svg" alt="burger-menu" />
                </a>
              </button>
            </div>

        <Link to="/search" className="top-bar__search-second">
          <div className="top-bar__search-container-second">
            <div className="top-bar__search-elements-second">
              <div className="top-bar__search-icon-second">
                <img
                  src="/icons/header/search.svg"
                  alt="search"
                  className="top-bar__search-item"
                />
              </div>
              <div className="top-bar__search-text">Search Model</div>
            </div>
          </div>
        </Link>
      </div>

      <main className="main">
        <section className="our-models man-models">
          <div className="our-models__block">
            {models.slice(0, 24).map((model, index) => (
              <Link
                to={`/models/men/${model.id}`}
                key={index}
                className="our-models__link"
              >
                <div className="our-models__card">
                  <div className="our-models__img">
                    <img
                      src={model.image_url}
                      alt={model.full_name || "Model"}
                    />
                  </div>
                  <div className="our-models__info">
                    <div className="our-models__name">
                      {model.full_name || "Loading..."}
                    </div>
                    <div className="our-models__location">
                      {model.city || "City"}, {model.country || "Country"}
                    </div>
                  </div>
                </div>
              </Link>
            ))}
          </div>
        </section>
      </main>

      <Footer />
    </>
  );
};

export default Search;
